// 运动热量消耗查询
var hot_num = 150;//默认是散步
jQuery(".sports .select-item").click(function(){
	jQuery(this).toggleClass("on");
	jQuery(this).find(".select-option").toggle();
	jQuery(this).find(".select-option li").hover(function(){jQuery(this).addClass("current");},function(){jQuery(this).removeClass("current");});
	jQuery(this).find(".select-option li").click(function(){
        jQuery(".sports .select-item").find(".selectd").text(jQuery(this).text());
        hot_num = jQuery(this).attr("title");
    });
});

jQuery("#hotbut").click(function () {
    var txt = jQuery(".selectd").html();
    var hour = jQuery("#hour").val();
    if(hour == ""){
        alert("请输入运动时间，以小时为单位！");
        jQuery("#hour").focus();
        return;
    }
    var val = hot_num * hour;
    alert("您做的运动是：" + txt + "\r\n运动的时间是：" + hour + "小时\r\n您消耗的热量是：" + val + "千焦");
});

